import {useState} from 'react';
import {Dimensions, StyleSheet, View} from 'react-native';
import Pdf from 'react-native-pdf';
import {StackScreenProps} from '@react-navigation/stack';
import {Button, Layout, Modal, Text} from '@ui-kitten/components';
import {
  LoadingIndicator,
  Message,
  PropsMessageModal,
  TopNavigationApp,
} from '../../components';
import {RootStackParams} from '../../navigation/StackNavigator';

interface Props
  extends StackScreenProps<RootStackParams, 'CertificateScreen'> {}

export const CertificateScreen = ({navigation, route}: Props) => {
  const {certificateId} = route.params;
  const [isLoading, setIsLoading] = useState(false);
  const [visibleModal, setVisibleModal] = useState(false);
  const [modalInfo, setModalInfo] = useState({
    title: 'Aviso',
    content: '',
    type: 'success',
  } as PropsMessageModal);

  const source = {
    uri: 'data:application/pdf;base64,',
  };

  const onCloseModal = () => {
    setVisibleModal(false);
  };

  const downloadPDF = async () => {
    setIsLoading(true);

    setModalInfo({
      title: 'Exito',
      content:
        'Se ha envido tu certificado al correo electrnico luis***@g***.com.',
      type: 'success',
    } as PropsMessageModal);
    setVisibleModal(true);
    setIsLoading(false);
  };

  return (
    <>
      <TopNavigationApp title="Obtener Certificado" />
      <Layout style={{flex: 1}}>
        <Layout style={{marginTop: 20}}></Layout>
        <Layout style={styles.container}>
          <Pdf source={source} style={styles.pdf} />
        </Layout>
      </Layout>
      <View style={styles.cardContainer}>
        <Button
          disabled={isLoading}
          onPress={() => downloadPDF()}
          style={styles.button}>
          {isLoading ? (
            <LoadingIndicator />
          ) : (
            evaProps => (
              <Text
                {...evaProps}
                style={{fontSize: 20, color: 'white'}}
                category="label">
                Obtener
              </Text>
            )
          )}
        </Button>
      </View>

      {/* MODAL */}
      <Modal
        backdropStyle={{backgroundColor: 'rgba(0, 0, 0, 0.5)'}}
        onBackdropPress={onCloseModal}
        visible={visibleModal}
        shouldUseContainer={false}
        animationType="slide"
        children={
          <Message
            title={modalInfo.title}
            content={modalInfo.content}
            type={modalInfo.type}
            onContinue={onCloseModal}
          />
        }
      />
    </>
  );
};
const styles = StyleSheet.create({
  container: {
    backgroundColor: 'transparent',
    width: Dimensions.get('window').width,
    height: Dimensions.get('window').height,
    justifyContent: 'flex-start',
    alignItems: 'center',
  },
  pdf: {
    width: Dimensions.get('window').width,
    height: Dimensions.get('window').height / 1.4,
    // backgroundColor: 'transparent',
  },
  cardContainer: {
    position: 'absolute',
    bottom: 20,
    padding: 20,
    width: Dimensions.get('window').width,
  },
  button: {
    borderRadius: 50,
    width: '100%',
  },
});
